Jco represents variants as objects with a tag that represents the variant, and val that represents the content: For example, pseudo Typescript for the of the above filter variant would look like the following: // Filter with all
{ tag: 'all';
} // Filter with None
{ tag: 'none';
} // Filter with some and a list of strings
{ tag: 'some'; val: string[];
} note WIT variant's options may only contain one piece of data. You can work around this limitation of variants by having the contained type be a tuple , (e.g. tuple<string, u32, string>), or using a named record as the related data.

