When used in the context of arguments or return to a function, single level options are represented as optional values: Consider the following interface: interface optional { f: func(n: option<u32>) -> string;
} An implementation of the function optional.f would look like the following Typescript: function f(n?: number): string { if (n === undefined) { return "no n provided"; } return "n was provided";
}

