When a result is returned directly from a function, any thrown error of the function is treated as the result error type, while any direct return value is treated as the result success type. Consider the following interface: interface fallible { f: func(n: u32) -> result<string, string>;
} An implementation of the function fallible.f would look like the following Typescript: function f(n: number): string { if (n == 42) { return "correct"; } throw "not correct";
}

