A result stored inside a container type or in non-function argument/return contexts will look like a variant type of the form { tag: 'ok', val: SuccessType } | { tag: 'err', val: ErrorType }. For example, consider the following WIT interface: interface fallible-reaction { r: func(r: result<string, string>) -> string;
} An implementation of the function fallible-reaction.r would look like the following Typescript: type Result<T,E> = { tag: 'ok', val: T } | { tag: 'err', val: E }; function f(input: Result<string, string>): string { switch (input.tag) { case 'ok': return `SUCCESS, returned: [${input.val}]"; case 'err': return `ERROR, returned: [${input.val}]"; // We we should never reach the case below default: throw Error("something has gone seriously wrong"); }
}

