When running a component in a JS host, it is likely for host functions to throw real JS errors (objects which are descendants of the Error global object ), rather than the exact type expected by Jco. This means that the default conversion mechanism for Jco would be a JS anti-pattern (i.e. throw 12345 versus throw new Error("error code 12345")). To ensure smooth use of Jco-generated code from hosts, Error objects with a payload property will have the payload extracted as the result error type. Consider the following WIT: type error-code = u32; interface only-throws { just-throw: func() -> result<string, error-code>;
} Consider the following host function adhering to the interface, and making use of idiomatic JS errors: // The below code assumes interaction with a WIT which looks like a
function justThrow() { const plainError = new Error("Error for JS users"); const errorWithPayload = Object.assign(plainError, { payload: 1111 }); throw errorWithPayload;
}

