Tuples are a container type that has a fixed size, types somewhat analogous to a fixed size list. Tuples can be combined with type renaming to produce types that carry some semantic meaning. For example: type point = tuple<u32,u32> Note that tuples can be combined with custom user-defined types like records and variants, options and results. For example: variant example-var { nothing, value(u64),
} record example-rec { fst: string, snd: u32,
} type maybe-num = option<u32>; type num-or-err-str = result<u32, string>; type examples = tuple<example-rec, example-var, maybe-num, num-or-err-str>;

